import Layout from "../components/Layout";
import {Button} from 'react-bootstrap'

function Iletisim() {
 return (
  <Layout title={"İletişim"} headText={"İletişim"}>
   <Button variant="success">Success</Button>
  </Layout>
 );
}

export default Iletisim;
